" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Large cell neuroendocrine carcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 389px; height: 260px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power photomicrograph showing cells with an organoid architecture. The cells have a modest amount of eosinophilic cytoplasm and nuclei with coarse chromatin and prominent nucleoli. An area of necrosis is seen in the lower right hand portion of the photomicrograph, which is characteristic of large cell neuroendocrine carcinoma.",
"    <div class=\"footnotes\">",
"    </div>",
