" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Maternal endocrine and metabolic adaptation to pregnancy",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?12/61/13274/contributors\">",
