var title_f12_61_13276="Classification of morphea";
var content_f12_61_13276=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F56238&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F56238&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification of morphea",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Morphea&nbsp;subtype",
"       </td>",
"       <td class=\"subtitle1\">",
"        Modifiers",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        <strong>",
"         Circumscribed",
"        </strong>",
"       </td>",
"       <td>",
"        Superficial",
"       </td>",
"       <td>",
"        Single or multiple oval/round lesions limited to epidermis and dermis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Deep",
"       </td>",
"       <td>",
"        Single or multiple oval/round lesions involving subcutaneous tissue, fascia or muscle",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        <strong>",
"         Linear",
"        </strong>",
"       </td>",
"       <td>",
"        Trunk/limbs",
"       </td>",
"       <td>",
"        Linear lesions involving possible primary site of involvement in subcutaneous tissue without involvement of skin, dermis, subcutaneous tissue, muscle or bone",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Head",
"       </td>",
"       <td>",
"        En coup de sabre, progressive facial hemiatrophy, linear lesions of the face (may involve underlying bone)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Generalized",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Coalescent plaque",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &ge;4 plaques in at least 2 of 7 anatomic sites (head-neck, right/left upper extremity, right/left lower extremity, anterior/posterior trunk); isomorphic pattern: coalescent plaques inframammary fold, waistline, lower abdomen, proximal thighs; symmetric pattern: symmetric plaques circumferential around breasts, umbilicus, arms, and legs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. Pansclerotic",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Circumferential involvement of majority of body surface area (sparing fingertips and toes), affecting skin, subcutaneous tissue, muscle or bone; no internal organ involvement",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Mixed",
"        </strong>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Combination of any above subtype (eg, linear-circumscribed)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted with permission from: Laxer RM, Zulian FB. Localized scleroderma. Curr Opin Rheumatol 2006; 18:606. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
