var title_f12_61_13277="Adherence improvement patients";
var content_f12_61_13277=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F57486%7EID%2F78917%7EID%2F68684&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=17\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F57486%7EID%2F78917%7EID%2F68684&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=17\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Strategies to improve adherence: patient and medication-related",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Inform patient regarding side effects.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anticipate and treat side effects.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Simplify food requirements.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Avoid adverse drug interactions.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If possible, reduce dose frequency and number of pills.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Negotiate a treatment plan that the patient understands and to which",
"he/she commits.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Spend time and multiple encounters to educate and explain goals of",
"therapy and need for adherence.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Establish readiness to take medication before writing first",
"prescription.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Recruit family and friends to support the treatment plan.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Develop concrete plan for specific regimen by considering meals",
"schedule, daily routines, and side effects.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Provide written schedule and pictures of medications, daily or weekly",
"pillboxes, alarm clocks, pagers, or other mechanical aids for adherence.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Develop adherence support groups or add adherence concerns to agenda of",
"other support groups.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Develop link with local community-based organizations regarding",
"adherence combined with educational sessions and practical strategies.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consider practice sessions using candy instead of pills.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     file://aidsinfo.nih.gov.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Strategies to improve adherence: clinician and health team-related",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Establish trust.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serve as educator and information source with ongoing support and",
"monitoring.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Provide access between visits for questions or problems (eg, by",
"providing a pager number), including during vacations or conferences.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Monitor ongoing adherence; intensify management during periods of",
"suboptimal adherence (ie, more frequent visits, recruitment of family",
"or friends,",
"deployment of other team members, and referral for mental health or",
"chemical-dependency services).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Use health team for all patients, including patients with special needs",
"(eg, use peer educators for adolescents or for injection-drug users).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consider impact of new diagnoses on adherence (eg, depression, liver",
"disease, wasting, or recurrent chemical dependency) and include",
"adherence intervention in management.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Use nurses, pharmacists, peer educators, volunteers, case managers,",
"drug counselors, clinician's assistants, nurse practitioners, and",
"research nurses to reinforce adherence messages.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Provide training to support team regarding antiretroviral therapy and",
"adherence.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Add adherence interventions to job descriptions of support team",
"members; add continuity-of-care role to improve patient access.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     file://aidsinfo.nih.gov.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Interventions to improve adherence",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Pharmacist-based adherence encounters and clinics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Multidisciplinary adherence encounters at each visit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Reminders, alarms, pagers, or timers on pillboxes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Patient education aids, including regimen pictures, calendars, or",
"stickers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clinician education aids (eg, medication guides, pictures, or calendars)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     file://aidsinfo.nih.gov.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
